import React, { useState } from 'react';
import { useCart } from '../CartContext';

function CheckoutPage() {
  const { cart, checkout, storeLocations } = useCart();
  const [name, setName] = useState('');
  const [address, setAddress] = useState('');
  const [city, setCity] = useState('');
  const [state, setState] = useState('');
  const [zipCode, setZipCode] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [deliveryType, setDeliveryType] = useState('home');
  const [creditCard, setCreditCard] = useState('');
  const [warranty, setWarranty] = useState(false);
  const [specialDiscount, setSpecialDiscount] = useState(0);
  const [totalCost, setTotalCost] = useState(calculateTotalCost());

  // Define warranty prices
  const warrantyPrices = {
    basic: 10,
    premium: 20,
  };

  // Calculate total cost with or without warranty
  function calculateTotalCost() {
    let cost = cart.reduce((sum, item) => sum + (item.price * item.quantity), 0);
    if (warranty) {
      cost += warrantyPrices.basic; // or premium if selected
    }
    cost -= specialDiscount; // apply special discount
    return cost;
  }

  function handleWarrantyChange(event) {
    setWarranty(event.target.checked);
    setTotalCost(calculateTotalCost());
  }

  function handleDeliveryTypeChange(event) {
    setDeliveryType(event.target.value);
  }

  function handleCreditCardChange(event) {
    setCreditCard(event.target.value);
  }

  function handleSubmit(event) {
    event.preventDefault();
    // Save form data to local storage
    localStorage.setItem('customerData', JSON.stringify({
      name,
      address,
      city,
      state,
      zipCode,
      phoneNumber,
      deliveryType,
      creditCard,
      warranty,
      specialDiscount,
    }));
    // Call checkout function from context
    checkout({
      name,
      address,
      city,
      state,
      zipCode,
      phoneNumber,
      deliveryType,
      creditCard,
      warranty,
      specialDiscount,
    });
  }

  return (
    <div className="checkout-page">
      <h2>Checkout</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Name:</label>
          <input type="text" value={name} onChange={(e) => setName(e.target.value)} required />
        </div>
        <div>
          <label>Address:</label>
          <input type="text" value={address} onChange={(e) => setAddress(e.target.value)} required />
        </div>
        <div>
          <label>City:</label>
          <input type="text" value={city} onChange={(e) => setCity(e.target.value)} required />
        </div>
        <div>
          <label>State:</label>
          <input type="text" value={state} onChange={(e) => setState(e.target.value)} required />
        </div>
        <div>
          <label>Zip Code:</label>
          <input type="text" value={zipCode} onChange={(e) => setZipCode(e.target.value)} required />
        </div>
        <div>
          <label>Phone Number:</label>
          <input type="text" value={phoneNumber} onChange={(e) => setPhoneNumber(e.target.value)} required />
        </div>
        <div>
          <label>Delivery Type:</label>
          <select value={deliveryType} onChange={handleDeliveryTypeChange}>
            <option value="home">Home Delivery</option>
            <option value="store">In-Store Pickup</option>
          </select>
        </div>
        {deliveryType === 'home' && (
          <div>
            <label>Credit Card:</label>
            <input type="text" value={creditCard} onChange={handleCreditCardChange} required />
          </div>
        )}
        <div>
          <label>
            <input type="checkbox" checked={warranty} onChange={handleWarrantyChange} />
            Add Warranty
          </label>
        </div>
        <div>
          <label>Special Discount:</label>
          <input type="number" value={specialDiscount} onChange={(e) => setSpecialDiscount(Number(e.target.value))} />
        </div>
        <div>
          <h3>Order Summary</h3>
          <p>Total Cost: ${totalCost.toFixed(2)}</p>
        </div>
        <button type="submit">Place Order</button>
      </form>
    </div>
  );
}

export default CheckoutPage;
